        </span>
        <span _ngcontent-c34="" class="prizren-faq-content-description" style="text-align: left">
            • Personalización de sus productos para su fácil 
identificación.
• Afiliación automática de todos sus productos para tener toda su 
información financiera a la mano. 
• Registro de cuentas como favoritas para fácil acceso en futuras 
transacciones. 
• Autorización de transacciones por medio de PIN o token para brindar 
mayor seguridad. 
• Registro de transacciones recurrentes para agilizar pagos y 
transferencias frecuentes. 
• Una pantalla de inicio que le brindará consultas rápidas de saldos, 
últimas transacciones, tasa de cambio y acceso a transacciones 
frecuentes.
• Fácil acceso a las transacciones históricas de todos los productos 
afiliados.
        </span>
