            2. Olvide mi contraseña ¿Como la puedo recuperar?
        </span>
        <span _ngcontent-c34="" class="prizren-faq-content-description" style="text-align: left">
            Después de 3 intentos se bloquea el usuario. Ingresa tu 
usuario y presiona la opción de ¿Ha olvidado su contraseña? Y al 
finalizar la solicitud recibirás un correo con tu contraseña temporal. 
Coloca en el espacio de contraseña anterior la contraseña temporal y 
recuerda que tu nueva contraseña debe cumplir con:
• Mínimo de 8 caracteres
• Como mínimo una letra mayúscula 
• Como mínimo una letra minúscula 
• Como mínimo un número
Al cambiar la contraseña se te solicitará ingresar nuevamente.
        </span>
    </div>
    <div _ngcontent-c34="" class="clearboth"></div>
