        </span>
        <span _ngcontent-c34="" class="prizren-faq-content-description" style="text-align: left">
            Ingresa la opción ¿Ha olvidado su usuario?, ingresa tu 
número de identidad, pasaporte o carnet de residente si eres extranjero;
 ingresa tu correo electrónico registrado y da clic en confirmar, se te 
enviará tu usuario por correo electrónico.  
