 correo con tu nuevo usuario y contraseña temporal, la cual al ingresar 
por primera vez se te solicitará cambiarla por una contraseña nueva.
Tu nueva contraseña debe cumplir con:
• Mínimo de 8 caracteres
• Como mínimo una letra mayúscula 
• Como mínimo una letra minúscula
• Como mínimo un número
Al ingresar por primera vez configuras tu información personal:  Pin 
Transaccional y Pregunta secreta, recuerda memorizar estos datos para 
una mejor experiencia.
        </span>
